import "../css/list.css";
import Button from "./Button";

function List({ item }) {
  return (
    <li className="listWrapper">
      <span>{ item.quentity }</span>
      <p style={ item.packed ? { textDecoration: "line-through" } : {} }>{ item.product }</p>
      <div>
        <Button className="doneBtn" content="Done"/>
        <Button className="deleteBtn" content="Delete"/>
      </div>
    </li>
  );
}
export default List;
